$(document).ready(function(){$(".faq_toggle").on("click",function(){$(this).hasClass("open")||$(".faq_toggle.open").click();let t=$(this).siblings(".faq_content");if($(this).hasClass("open"))t.animate({height:"0px"},400);else{t.css("height","auto");let e=t.height();t.css("height","0px"),t.animate({height:e},400,function(){t.css("height","auto")})}$(this).toggleClass("open")})});
